def continuedSurface(surface):
    first = min(surface)
    last = max(surface)
    firstTest = False
    missing = []
    if (last - first + 1) == len(surface):
        firstTest = True
    else:
        for i in range(first, last):
            if i not in surface:
                missing.append(i)
    return missing


def getNumberOfSurfaces(knoten):
    listOfKnots = list(knoten.keys())
    surfaces = []
    while listOfKnots:
        s = getBesucht(knoten, listOfKnots[0], -1)
        for k in s:
            listOfKnots.remove(k)
        surfaces.append(s)
    return len(surfaces)


def getDictOfSurfaces(knoten):
    listOfKnots = list(knoten.keys())
    surfaces = {}
    nSurface = 0
    while listOfKnots:
        s = getBesucht(knoten, listOfKnots[0], -1)
        for k in s:
            listOfKnots.remove(k)
        surfaces[nSurface] = s
        nSurface += 1
    return surfaces


def breitensuche(adj, start, suche):
    # adj ist die Adjazenzliste {knoten: [kanten]}
    # start ist der Index des Knoten, in dem die Suche beginnt
    # suche ist der gesuchte Knoten
    queue = q.Queue()
    queue.put(start)
    besucht = set()
    while queue.qsize() > 0:
        aktiverKnoten = queue.get()
        besucht.add(aktiverKnoten)
        for andererKnoten in adj[aktiverKnoten]:
            if andererKnoten in besucht:
                continue
            if andererKnoten == suche:
                # Knoten gefunden
                return True
            queue.put(andererKnoten)
    return False


def getBesucht(adj, start, suche):
    # adj ist die Adjazenzliste {knoten: [kanten]}
    # start ist der Index des Knoten, in dem die Suche beginnt
    # suche ist der gesuchte Knoten
    queue = q.Queue()
    queue.put(start)
    besucht = set()
    while queue.qsize() > 0:
        aktiverKnoten = queue.get()
        besucht.add(aktiverKnoten)
        for andererKnoten in adj[aktiverKnoten]:
            if andererKnoten in besucht:
                continue
            if andererKnoten == suche:
                # Knoten gefunden
                return besucht
            queue.put(andererKnoten)
    return besucht


def getDictOfKnots(listOfFaces, listOfVerts):
    knotenDict = dict()
    for i in range(len(listOfVerts)):
        knotenDict[i] = set()
        for triangle in listOfFaces:
            if i in triangle:
                for knot in triangle:
                    if knot != i:
                        knotenDict[i].add(knot)
    return knotenDict


